do a donde se supone que deberan hacerlo.\n\nRecuerda que la pgina \'\'\'no\'\'\' ser renombrada si ya existe una pgina con el nuevo ttulo, a no ser que sea una pgina vaca o una redireccin sin historial.\nEsto significa que podrs renombrar una pgina a su ttulo original si has cometido un error, pero que no podrs sobrescribir una pgina existente.\n\n\'\'\'Aviso!\'\'\'\nEste puede ser un cambio drstico e inesperado para una pgina popular;\npor favor, asegrate de entender las consecuencias del procedimiento antes de seguir adelante.\";'),('es','messages:movepagetext-noredirectfixer','s:893:\"Usando el siguiente formulario se renombrar una pgina, moviendo todo su historial al nuevo nombre.\nEl ttulo anterior se convertir en una redireccin al nuevo ttulo.\nAsegrate de no dejar [[Special:DoubleRedirects|redirecciones dobles]] o [[Special:BrokenRedirects|rotas]].\nT eres responsable de hacer que los enlaces sigan apuntando adonde se supone que deberan hacerlo.\n\nRecuerda que la pgina \'\'\'no\'\'\' ser renombrada si ya existe una pgina con el nuevo ttulo, a no ser que sea una pgina vaca o una redireccin sin historial.\nEsto significa que podrs renombrar una pgina a su ttulo original si has cometido un error, pero que no podrs sobrescribir una pgina existente.\n\n\'\'\'Aviso!\'\'\'\nEste puede ser un cambio drstico e inesperado para una pgina popular;\npor favor, asegrate de entender las consecuencias del procedimiento antes de seguir adelante.\";'),('es','messages:movepagetalktext','s:395:\"La pgina de discusin asociada, si existe, ser renombrada automticamente \'\'\'a menos que:\'\'\'\n*Est moviendo la pgina entre espacios de nombres diferentes,\n*Una pgina de discusin no vaca ya exista con el nombre nuevo, o\n*No actives la opcin Renombrar la pgina de discusin tambin.\n\nEn estos casos, debers trasladar manualmente el contenido de la pgina de discusin.\";'),('es','messages:movearticle','s:17:\"Renombrar pgina\";'),('es','messages:moveuserpage-warning','s:157:\"\'\'\'Aviso:\'\'\' ests a punto de mover una pgina de usuario. Ten en cuenta de que solo la pgina ser trasladada pero el usuario \'\'\'no\'\'\' ser renombrado.\";'),('es','messages:movenologin','s:23:\"No has iniciado sesin\";'),('es','messages:movenologintext','s:110:\"Es necesario ser usuario registrado y [[Special:UserLogin|haber iniciado sesin]] para renombrar una pgina.\";'),('es','messages:movenotallowed','s:38:\"No tienes permiso para mover pginas.\";'),('es','messages:movenotallowedfile','s:38:\"No tienes permiso para mover archivos.\";'),('es','messages:cant-move-user-page','s:71:\"No tienes permiso para mover pginas de usuario (excepto subpginas).\";'),('es','messages:cant-move-to-user-page','s:101:\"No tienes permiso para mover una pgina a una pgina de usuario (excepto a subpginas de usuario).\";'),('es','messages:newtitle','s:16:\"A ttulo nuevo:\";'),('es','messages:move-watch','s:36:\"Vigilar pginas de origen y destino\";'),('es','messages:movepagebtn','s:17:\"Renombrar pgina\";'),('es','messages:pagemovedsub','s:31:\"Renombrado realizado con xito\";'),('es','messages:movepage-moved','s:41:\"\'\'\'$1 ha sido trasladado a $2.\'\'\'\";'),('es','messages:movepage-moved-redirect','s:30:\"Se ha creado una redireccin.\";'),('es','messages:movepage-moved-noredirect','s:48:\"Se ha suprimido la creacin de la redireccin.\";'),('es','messages:articleexists','s:111:\"Ya existe una pgina con ese nombre, o el nombre que has escogido no es vlido.\nPor favor, elige otro nombre.\";'),('es','messages:cantmove-titleprotected','s:113:\"No puedes mover la pgina a esta ubicacin, porque el nuevo ttulo ha sido protegido para evitar su creacin.\";'),('es','messages:talkexists','s:163:\"La pgina fue renombrada con xito, pero la discusin no se pudo mover porque ya existe una en el ttulo nuevo. Por favor incorpora sus contenidos manualmente.\";'),('es','messages:movedto','s:12:\"renombrado a\";'),('es','messages:movetalk','s:43:\"Renombrar la pgina de discusin asociada\";'),('es','messages